import React from 'react';
import { SafeAreaView } from 'react-native';
import Navigator from './ExploreList'

export default function Explore() {
    return (
    <SafeAreaView style={global.backgroundColor}>
        <Navigator/> 
    </SafeAreaView>
    );
}
